import React from 'react';

import {
  Container,
  Header,
  Info,
  Logo,
  User,
  UserGreting,
  UserName,
  Icon,
  HeadWapper
} from './styles';

import { HighlightCard } from '../../components/HighlightCard';



export function Dashboard() {
  return (
    <Container>
      <Header>
        <HeadWapper>
          <Info>
            <Logo />
            <User>
              <UserGreting>Ol√°, </UserGreting>
              <UserName>Hemerson</UserName>
            </User>
          </Info>
          <Icon name="logout" />
        </HeadWapper>
      </Header>
      <HighlightCard />
    </Container>
  );
}
